export default {
    name: 'c_select',
    props: {
        name: {
            type: String
        },
        configData:{
            type:null
        }
    },
    data () {
        return {
            defaults: {},
            datas: this.configData
        }
    },
    mounted () {
        this.bus.$on('upData',data=>{
            this.datas[this.name].list = data
            this.bus.$off()
        })
    },
    watch: {
        configData: {
            handler (nVal, oVal) {
                this.datas = nVal
            },
            deep: true
        }
    },
    methods: {
        sliderChange (e) {
            this.$emit('getConfig', { name: 'select', values: e })
        }
    }
}
